import React from 'react';
import { styled } from "@mui/material/styles";
import Paper from "@mui/material/Paper";
import "./AircraftItem.css";
import useRotationStack from '../../../../store/useRotationStack';
import AirplaneTicketIcon from "@mui/icons-material/AirplaneTicket";
import AirplanemodeActiveIcon from "@mui/icons-material/AirplanemodeActive";


const Item = styled(Paper)(({ theme }) => ({
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
  width: "50vh",
  marginTop: "8px"
}));


type Props = {
  aircraft: any;
};

const AircraftItem: React.FC<Props> = ({ aircraft }) => {
  const { addFlightToRotation } = useRotationStack((state) => ({
    addFlightToRotation: state.addFlightToRotation,
  }));

  const handleOnClick = () => addFlightToRotation(aircraft);

  return (
    <Item onClick={handleOnClick}>
      <div className="card-header">
        <div className="card-title">
          {"Aircraft: "}
          <b>{"rugir de leon"}</b>
        </div>
        <div className="card-icon">
          <AirplanemodeActiveIcon color="primary" />
        </div>
      </div>
      <div className="card-body">
        <div className="card-body_column">
          <div style={{ textAlign: "left" }}>Ocupation percentage:</div>
        </div>
        <div className="card-body_column">
          <div style={{ textAlign: "right" }}>
            <b>{"buyakasha"}</b>
          </div>
        </div>
      </div>
    </Item>
  );
};

export default AircraftItem;
